@davidceo, I just posted a new sketch, with integrated image file drag and drop. The code works perfectly from my local p5js. It doesnt work on Openprocessing because, curiously, I cant access the canvas.... It works on other sharing sites though, thanks to GoToLoop tricks!
If you like the effect, I ported it to Android a while ago, you can find it here: https://play.google.com/store/apps/details?id=com.marzinp.mycelium&hl=fr
It's far from perfect, but it works^^

@davidceo Hi, same here, the downloaded p5 folders dont work... Dom library is not included!
In p5 editor, create a new project, paste my code instead of the default one.
Then put an image called "img.jpg" in the sketch's folder. Check if you have dom.js in the /library folder. It should work! If you still have problems, send me an email at marzinp@gmail.com, I'll send you the correct .zip!
